    <div className="grid grid-cols-2 place-content-center md:max-w-max md:mx-auto md:grid-cols-3 lg:grid-cols-5 mt-12">
      <div className="vignette flex justify-center items-center text-center bg-white z-0 md:h-80 w-80 mx-auto mr-3 pb-2 rounded-3xl shadow-xl">
        <p className="text-center">{cats.name}</p>
